function updateIssue(t,e,o){{var r=window.location.pathname.split("/")[2],s="/issues/"+r+"/update/"+t,u={oldLabel:e,newLabel:o};$.ajax({url:s,type:"POST",data:u,success:function(t){return console.log(t),!0},error:function(t){return console.log("Error: "+JSON.parse(t)),!1}})}}for(var issueGroups=document.getElementsByClassName("issue-list-group"),from="",to="",fromGroup="",toGroup="",i=0;i<issueGroups.length;i++){var issueMilestone=issueGroups[i].getAttribute("data-milestone");Sortable.create(issueGroups[i],{group:"issue-"+issueMilestone,animation:150,dragable:".issue-list-item",ghostClass:"sortable-ghost",onStart:function(t){var e=t.item.parentNode;from=e.getAttribute("data-label"),fromGroup=e.getAttribute("data-group")},onEnd:function(t){var e=t.item.getAttribute("data-issue-number"),o=t.item.parentNode;to=o.getAttribute("data-label"),toGroup=o.getAttribute("data-group"),from!=to&&fromGroup!=toGroup&&updateIssue(e,from,to)}})}